import React from 'react';

const MainPage: React.FC = () => {
  return (
    <div>
      <h1>Добро пожаловать в сервис бронирования услуг</h1>
      <p>Выберите из списка доступных услуг и забронируйте удобное время.</p>
    </div>
  );
};

export default MainPage;
